import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";

// Placeholder Components
const Account = () => <div className="page-container">Your Account Details</div>;
const Courses = () => (
  <div className="page-container">
    <h2>Explore Courses</h2>
    <div className="course-list">
      <div className="course-card">
        <h3>React for Beginners</h3>
        <p>Learn React from scratch and build dynamic web applications.</p>
        <button
          onClick={() => window.open("https://reactjs.org/", "_blank")}
          className="course-link"
        >
          Learn
        </button>
      </div>
      <div className="course-card">
        <h3>JavaScript Fundamentals</h3>
        <p>Understand JavaScript basics and write better code.</p>
        <button
          onClick={() => window.open("https://developer.mozilla.org/en-US/docs/Web/JavaScript", "_blank")}
          className="course-link"
        >
          Learn
        </button>
      </div>
    </div>
  </div>
);

const Subscription = () => <div className="page-container">Subscription Info</div>;
const Contact = () => <div className="page-container">Contact Us</div>;

function App() {
  const [theme, setTheme] = useState("light");
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleTheme = () => {
    setTheme(theme === "light" ? "dark" : "light");
  };

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <Router>
      <div className={theme === "dark" ? "dark-mode" : "light-mode"}>
        <header>
          <nav>
            <div className="nav-logo">My Course App</div>
            <div className="hamburger-menu" onClick={toggleMenu}>
              &#9776;
            </div>
            <ul className={`nav-links ${menuOpen ? "active" : ""}`}>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/account">Account</Link>
              </li>
              <li>
                <Link to="/courses">Courses</Link>
              </li>
              <li>
                <Link to="/subscription">Subscription</Link>
              </li>
              <li>
                <Link to="/contact">Contact</Link>
              </li>
            </ul>
            <div className="theme-toggle-container" onClick={toggleTheme}>
              <div className={`theme-toggle ${theme === "dark" ? "dark" : ""}`}></div>
            </div>
          </nav>
        </header>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/account" element={<Account />} />
          <Route path="/courses" element={<Courses />} />
          <Route path="/subscription" element={<Subscription />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>

        <footer>
          <p>Contact us at support@mycourseapp.com</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
